import React, { useEffect, useState } from "react";
import PanelTemplate from "./PanelTemplate";
import { jsPDF } from "jspdf";
import "jspdf-autotable";

function Reports() {
    const [reportData, setReportData] = useState([]);
    const [selectedPerson, setSelectedPerson] = useState(null);

    useEffect(() => {
        // Backend'den verileri çekiyoruz
        fetch("http://localhost:5000/manager/generalReport")
            .then(res => res.json())
            .then(data => {
                if (data.success) {
                    setReportData(data.report);
                }
            })
            .catch(err => console.error("API Bağlantı Hatası:", err));
    }, []);

    const downloadPDF = () => {
        const doc = new jsPDF();
        doc.text("Personel ve Musteri Genel Raporu", 14, 15);
        const rows = reportData.map(p => [`${p.first_name} ${p.last_name}`, p.rol, p.islem_sayisi, `${p.toplam_ciro} TL`]);
        doc.autoTable({
            head: [['Ad Soyad', 'Rol', 'Islem Sayisi', 'Toplam Ciro']],
            body: rows,
            startY: 25
        });
        doc.save("Genel_Rapor.pdf");
    };

    return (
        <PanelTemplate
            title="Reports"
            rightContent={
                <div style={{ padding: '20px', width: '100%' }}>
                    <h1 style={{ textAlign: 'center', marginBottom: '10px' }}>Genel Isletme Raporu</h1>

                    <div style={{ textAlign: 'center', marginBottom: '20px' }}>
                        <button onClick={downloadPDF} className="panel_button" style={{ cursor: 'pointer', padding: '10px 20px' }}>
                            PDF Olarak Indir
                        </button>
                    </div>

                    <table className="orders-table" style={{ width: '100%', borderCollapse: 'collapse', backgroundColor: 'white' }}>
                        <thead style={{ backgroundColor: '#2f4036', color: 'white' }}>
                            <tr>
                                <th style={{ padding: '12px', border: '1px solid #ddd' }}>ID</th>
                                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Ad Soyad</th>
                                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Rol</th>
                                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Islem Sayisi</th>
                                <th style={{ padding: '12px', border: '1px solid #ddd' }}>Toplam Ciro</th>
                            </tr>
                        </thead>
                        <tbody>
                            {reportData.length > 0 ? (
                                reportData.map((person) => (
                                    <tr key={person.person_id} style={{ borderBottom: '1px solid #ddd', textAlign: 'center' }}>
                                        <td style={{ padding: '12px' }}>{person.person_id}</td>
                                        <td style={{ padding: '12px' }}>{person.first_name} {person.last_name}</td>
                                        <td style={{ padding: '12px' }}>{person.rol}</td>
                                        <td style={{ padding: '12px' }}>{person.islem_sayisi}</td>
                                        <td style={{ padding: '12px', fontWeight: 'bold' }}>{person.toplam_ciro} TL</td>
                                    </tr>
                                ))
                            ) : (
                                <tr>
                                    <td colSpan="5" style={{ padding: '20px', textAlign: 'center' }}>Veri bulunamadı. Lütfen API ve veritabanı bağlantısını kontrol edin.</td>
                                </tr>
                            )}
                        </tbody>
                    </table>
                </div>
            }
        />
    );
}

export default Reports;
